// HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

// Import images
import v4Image from '../images/v4.png';
import v42Image from '../images/v42.png';
import v3Image from '../images/v3.png';
import v32Image from '../images/v32.png';
import v40Image from '../images/v40.png';
import owImage from '../images/ow.png';
import ow1Image from '../images/OW1.png';

function HomePage() {
  // Update pump data to use imported images
  const pumps = [
    { name: 'Rust free V4- Stainless Steel Pumps', image: v4Image, price: 'MRP ₹16,975.00', link: 'r1.html' },
    { name: 'Rust free V4- Stainless Steel Pumps', image: v42Image, price: 'MRP ₹16,250.00', link: 'r2.html' },
    { name: 'V3-Oil Filled Motor', image: v3Image, price: 'MRP ₹15,975.00', link: 'r3.html' },
    { name: 'V3- Water Filled Borewell Submersible Motor', image: v32Image, price: 'MRP ₹13,800.00', link: 'r4.html' },
    { name: 'V4- Oil Filled Motor', image: v40Image, price: 'MRP ₹12,525.00', link: 'r5.html' },
    { name: 'OW- Water Filled Motor', image: owImage, price: 'MRP ₹9,575.00', link: 'r6.html' },
    { name: 'OW – Dry Type Openwell Submersible Motor', image: ow1Image, price: 'MRP ₹15,500.00', link: 'r7.html' },
  ];

  const handleReadMore = (link) => {
    window.open(link, '_blank');
  };

  return (
    <div>
      {/* ... rest of your code ... */}

      {/* Pump Gallery */}
      <div className="pump-gallery" id="pumpGallery">
        {pumps.map((pump, index) => (
          <div key={index} className="pump-item">
            <img src={pump.image} alt={pump.name} />
            <div className="pump-info">
              <p className="pump-name">{pump.name}</p>
              <p className="pump-price">{pump.price}</p>
              <button 
                className="read-more-btn"
                onClick={() => handleReadMore(pump.link)}
              >
                Read more
              </button>
            </div>
          </div>
        ))}
      </div>

      {/* ... rest of your code ... */}
    </div>
  );
}

export default HomePage;
